// src/components/Skills.js
import React from 'react';

const skills = [
  { name: 'Python', level: 95 },
  { name: 'TensorFlow/Keras', level: 90 },
  { name: 'PyTorch', level: 85 },
  { name: 'Hugging Face', level: 90 },
  { name: 'NLP/Transformers', level: 88 },
  { name: 'LLM Fine-Tuning', level: 85 },
  { name: 'LangChain', level: 80 },
  { name: 'Docker', level: 75 },
  { name: 'AWS/Cloud', level: 70 },
  { name: 'SQL', level: 80 },
];

const Skills = () => {
  return (
    <section id="skills" className="py-16 bg-gray-50 dark:bg-gray-800">
      <div className="container mx-auto px-4">
        <h2 className="text-3xl font-bold text-center mb-4">Technical Expertise</h2>
        <p className="text-center text-gray-600 dark:text-gray-300 mb-12">
          Proven proficiency in cutting-edge ML technologies
        </p>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-8 max-w-4xl mx-auto">
          {skills.map((skill, index) => (
            <div key={index} className="bg-white dark:bg-gray-700 p-6 rounded-xl shadow-sm">
              <div className="flex justify-between mb-2">
                <span className="font-semibold">{skill.name}</span>
                <span className="text-indigo-600 dark:text-indigo-400">{skill.level}%</span>
              </div>
              <div className="w-full bg-gray-200 dark:bg-gray-600 rounded-full h-2.5">
                <div
                  className="bg-gradient-to-r from-indigo-500 to-purple-600 h-2.5 rounded-full"
                  style={{ width: `${skill.level}%` }}
                ></div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
